/**
 * Unit tests for class BigNumber.
 *
 * Most of the tests are performed in concrete classes.
 * Only static methods that can be called on BigNumber itself may justify tests here.
 */
class BigNumberTest extends AbstractTestCase
{
    /**
     * Specific tests for float handling. More generic tests are performed on concrete classes.
     *
     * @dataProvider providerOfFloat
     *
     * @param float  $number
     * @param string $expected
     *
     * @return void
     */
    public function testOfFloat(float $number, string $expected) : void
    {
        $result = BigNumber::of($number);

        $this->assertInstanceOf(BigDecimal::class, $result);
        $this->assertSame($expected, (string) $result);
    }

