    /**
     * @dataProvider providerOfInfinity
     *
     * @param float $number
     */
    public function testOfInfinity(float $number) : void
    {
        $this->expectException(NumberFormatException::class);
        $this->expectExceptionMessage('Cannot represent infinity as a BigNumber.');

        BigNumber::of($number);
    }

    /**
     * @return array
     */
    public function providerOfInfinity() : array
    {
        return [
            [INF],
            [-INF]
        ];
    }

    /**
     * @dataProvider providerOfNaN
     *
     * @param float $number
     */
    public function testOfNaN(float $number) : void
    {
        $this->expectException(NumberFormatException::class);
        $this->expectExceptionMessage('Cannot represent NaN as a BigNumber.');

        BigNumber::of($number);
    }

    /**
     * @return array
     */
    public function providerOfNaN() : iterable
    {
        yield [NAN];

        // FFF followed by any non-zero value is NaN

        $tests = [
            'FFF0000000000001',
            'FFF0000000000010',
            'FFF0000000000100',
            'FFF0000000001000',
            'FFF0000000010000',
            'FFF0000000100000',
            'FFF0000001000000',
            'FFF0000010000000',
            'FFF0000100000000',
            'FFF0001000000000',
            'FFF0010000000000',
            'FFF0100000000000',
            'FFF1000000000000',
            'FFF8000000000000',
            'FFFF000000000000',
        ];

        foreach ($tests as $hex) {
            yield [unpack('Ex', hex2bin($hex))['x']];
        }
    }

    /**
     * @dataProvider providerSum
     *
     * @param array  $values        The values to add.
     * @param string $expectedClass The expected class name.
     * @param string $expectedSum   The expected sum.
     */
    public function testSum(array $values, string $expectedClass, string $expectedSum)
    {
        $sum = BigNumber::sum(...$values);

        $this->assertSame($expectedClass, get_class($sum));
        $this->assertSame($expectedSum, (string) $sum);
    }

    /**
     * @return array
     */
    public function providerSum()
    {
        return [
            [[-1], BigInteger::class, '-1'],
            [[-1, '99'], BigInteger::class, '98'],
            [[-1, '99', '-0.7'], BigDecimal::class, '97.3'],
            [[-1, '99', '-0.7', '3/2'], BigRational::class, '1976/20'],
            [[-1, '3/2'], BigRational::class, '1/2'],
            [[-0.5], BigDecimal::class, '-0.5'],
            [[-0.5, 1], BigDecimal::class, '0.5'],
            [[-0.5, 1, '0.7'], BigDecimal::class, '1.2'],
            [[-0.5, 1, '0.7', '47/7'], BigRational::class, '554/70'],
            [['-1/9'], BigRational::class, '-1/9'],
            [['-1/9', 123], BigRational::class, '1106/9'],
            [['-1/9', 123, '8349.3771'], BigRational::class, '762503939/90000'],
            [['-1/9', '8349.3771', 123], BigRational::class, '762503939/90000']
        ];
    }
